export class ConfigDB {
	static data = {
		 settings: {
			 layout_type:  'dark-sidebar-body-mix',
		 sidebar: {
			 type: 'compact-wrapper',
			 body_type: 'sidebar-icon' 
		 },
		 sidebar_setting: 'dark-sidebar', 
		 },
		 color: {
			//  primary_color: '#7366ff', 
			 primary_color: '#a67c00', 
			 secondary_color: '#7366ff', 
			 mix_background_layout: 'dark-sidebar', 
		 },
		 router_animation: 'zoom fade'
	 }
   }
export default ConfigDB;
